import React from 'react';

function AboutPage() {
    return (
        <div className="about-page">
            <div className="container py-5">
                <h1 className="text-center mb-4">Về Chúng Tôi</h1>
                <div className="row">
                    <div className="col-md-6">
                        <h3>Câu chuyện của chúng tôi</h3>
                        <p>Chúng tôi là một cửa hàng thời trang với sứ mệnh mang đến những sản phẩm chất lượng cao với giá cả hợp lý cho khách hàng.</p>
                    </div>
                    <div className="col-md-6">
                        <h3>Tầm nhìn & Sứ mệnh</h3>
                        <p>Trở thành thương hiệu thời trang hàng đầu, mang đến những trải nghiệm mua sắm tốt nhất cho khách hàng.</p>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default AboutPage;
